```python
class Group:
    def __init__(self, elements, operation):
        """
        Initialize a group with a set of elements and a binary operation.

        :param elements: A list of elements in the group.
        :param operation: A function representing the binary operation.
        """
        self.elements = elements
        self.operation = operation

    def is_closed(self):
        """
        Check if the group is closed under the operation.

        :return: True if the group is closed, False otherwise.
        """
        for a in self.elements:
            for b in self.elements:
                if self.operation(a, b) not in self.elements:
